import React from "react";

const StepOne = ({ states }) => {
  return (
    <div className="row">
      <div className="radio">
        <label htmlFor="circle" />
        <input type="radio" name="shape" value="Circle" /> Circle
      </div>
      <div className="radio">
        <input type="radio" name="shape" value="Square" /> Square
      </div>
      <div className="radio">
        <input type="radio" name="shape" value="Ellipse" /> Ellipse
      </div>
      <div className="radio">
        <input type="radio" name="shape" value="Rectangle" /> Rectangle
      </div>
    </div>
  );
};

export default StepOne;
